-- Triggers `pets`
--
DELIMITER $$
CREATE TRIGGER `copy_photo_data` BEFORE INSERT ON `pets` FOR EACH ROW BEGIN
    IF NEW.photo IS NOT NULL THEN
        -- Only copy if photo contains binary data
        IF SUBSTRING(NEW.photo, 1, 4) != 'http' AND 
           SUBSTRING(NEW.photo, 1, 8) != 'uploads/' THEN
            SET NEW.photo_data = NEW.photo;
        END IF;
    END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `update_photo_data` BEFORE UPDATE ON `pets` FOR EACH ROW BEGIN
    IF NEW.photo IS NOT NULL AND NEW.photo != OLD.photo THEN
        SET NEW.photo_data = NEW.photo;
    END IF;
END
$$
DELIMITER ;

